/* harmony default export */ var terms = ({
  welcome: 'Welcome to Website RentUp!',
  rentupDesc: `These terms and conditions outline the rules and regulations for the use of RentUp's Website, located at Rentup.com.eg
    By accessing this website we assume you accept these terms and conditions. Do not continue to use Website Name if you do not agree to take all of the terms and conditions stated on this page.
    The following terminology applies to these Terms and Conditions, Privacy Statement and Disclaimer Notice and all Agreements: “Client”, “You” and “Your” refers to you, the person log on this website and compliant to the Company's terms and conditions. “The Company”, “Ourselves”, “We”, “Our” and “Us”, refers to our Company. “Party”, “Parties”, or “Us”, refers to both the Client and ourselves. All terms refer to the offer, acceptance and consideration of payment necessary to undertake the process of our assistance to the Client in the most appropriate manner for the express purpose of meeting the Client's needs in respect of provision of the Company's stated services, in accordance with and subject to, prevailing law of Egypt. Any use of the above terminology or other words in the singular, plural, capitalization and/or he/she or they, are taken as interchangeable and therefore as referring to same.`,
  landlords: 'Landlords',
  landlordSubHeading: 'a. Property Listing',
  landlordsContent: [`The Platform provides tools that make it easy for you to set up and manage a Listing. Your Listing must include complete and accurate information about your Property Type, Rental Term (long or short term), your Asking price, other charges like maintenance fees, security deposits and any rules`, `Listing titles & description Must not include irrelevant information, false, misleading, or deceptive information and must follow our guidelines mentioned below`, `Your listing must not be duplicated.`, `Please include your house rules if exists`, `Please be transparent with real condition of the property`, `User must not pretend to be the property owners if they are not.`, `By listing your property, you authorize Rentup to hold your details and market your property`],
  offers: 'b. Offers',
  offersContent: [`Accepting offers means you ‘ve reviewed the offer details and the tenant profile, we do not expect you raise the price after accepting`, `Owners reserves the right to refuse serving any client for any reason.`],
  responsibilities: 'c. Responsibilities',
  responsibilitiesContent: [`You are responsible for keeping your Listing information (including calendar availability) and content (like photos) up-to-date and accurate at all times.`, `We advise you to follow the tax regulations in Egypt`, `Please inform the nearest police office if your property has been rented`, `Please have a copy of Tenants National ID and Passports for foreigners`],
  tenants: 'Tenants',
  tenantsSubtitle: `a. If you enquire about a property on this Website, you acknowledge and agree that your details will be sent to property owners or their representatives`,
  tenantsContent: [`<strong>Offers:</strong>  While accepting initial offer is not binding, but we expect that your offers to the owners are serious.`],
  accuracy: '<strong>b. Accuracy:</strong>',
  accuracyContent: [`we do not guarantee or hold any responsibility for the accuracy or completeness of any information contained within the Details.`, `The materials appearing on the Website could include technical, typographical, or photographic errors. We do not warrant that any of the materials on its Website are accurate, complete, or current. We may make changes to the materials contained on the Website at any time without notice..`],
  GeneralTerms: '<strong>General Terms:</strong>',
  GeneralTermsContent: [`We allow users to write content on the platform in order to share their experiences, communicate with other users and promote their properties.`, `Users should abide by the following guidelines, also they hold full responsibility for the content they write, users are forbidden to write:`],
  GeneralTermsSubContent: [`Content that is not relevant to a user, property, booking or experience`, `Content for the purpose of advertising or other commercial content, including company logos, links, or company names, products or services.`, `Spam, unwanted contact, or content that is shared repeatedly in a disruptive manner`, `Content that endorses or promotes illegal or harmful activity, or that is sexually explicit, violent, graphic, threatening, or harassing or political or religious views`, `Content that is discriminatory, attempts to impersonate another person, account, or entity.`, `Content that includes another person’s private or confidential information, including content that is sufficient to identify a listing’s location`, `Do not lie, misrepresent something or someone, or pretend to be someone else.`, `Be polite and respectful when you communicate or interact with others.`, `Review should be genuine & unbiased`, `The users accept to pay Rentup the charge of the service whether its subscriptions, commissions or else`],
  GeneralTermsSubContent2: [` Account or content deletion:`, `We are allowing our bots to review the content written on the website, if it doesn’t follow the guidelines, we may delete part or entire content or even a deactivate a user account.`],
  legal: 'Legal',
  legalSubtitle: 'You must follow the Security, Privacy and other rules:',
  legalSubtitleSecond: `<strong>Security of the platform</strong>`,
  legalContent: [`Do not scrape, hack, reverse engineer, compromise or impair the Rentup Platform`, `Do not use bots, crawlers, scrapers, or other automated means to access or collect data or other content from or otherwise interact with the Rentup Platform.`, `Do not hack, avoid, remove, impair, or otherwise attempt to circumvent any security or technological measure used to protect the Rentup Platform or Content.`, `Do not decipher, decompile, disassemble, or reverse engineer any of the software or hardware used to provide the Rentup Platform.`, `Do not take any action that could damage or adversely affect the performance or proper functioning of the Rentup Platform.`, `Understand and follow the laws that apply to you, including privacy, data protection, and export laws.`, `If you provide us with someone else’s personal information, you: (i) must do so in compliance with applicable law, (ii) must be authorized to do so, and (iii) authorize us to process that information under our <a style="color:#00f" href="/privacy-policy">Privacy Policy.</a>`, `Do not use the name, logo, branding, or trademarks of Rentup or others without permission.`, `Do not offer or solicit prostitution or participate in or facilitate human trafficking.`, `Only use the Rentup Platform as authorized by these Terms or another agreement with us`, `Do not use the Rentup Platform, our messaging tools, or Members’ personal information to send commercial messages`, `Do not use Content unless you have permission from the Content owner or the use is authorized by us in these Terms or another agreement you have with us.`, `Do not request, make, or accept a booking or any payment outside of the Rentup Platform to avoid paying fees, taxes or for any other reason.`, `Do not engage in any practices that are intended to manipulate our search algorithm.`, `Do not use, copy, display, mirror or frame the Rentup Platform, any Content, any Rentup branding, or any page layout or design without our consent.`],
  INTELLECTUALPROPERTY: 'INTELLECTUAL PROPERTY',
  INTELLECTUALPROPERTYCONTENT: [`Unless otherwise expressly stated, all contents of the Website are copyrights, trademarks, trade dress and/or other intellectual property owned, controlled or licensed by us, or one of our affiliates or by third parties who have licensed their materials to us and are protected by the applicable laws.`, `We, together with our suppliers and licensors expressly reserve all intellectual property rights in all text, programs, products, processes, technology, content and other materials, which appear on this Website. Access to this Website does not confer and shall not be considered as conferring upon anyone any license under any of our or any third party's intellectual property rights. Any use of this Website or its contents, including copying or storing it or them in whole or part, other than for your own personal, non-commercial use, is prohibited without our permission. You may not modify, distribute or re-post anything on this Website for any purpose.`, `Our names and logos and all related product and service names, design marks and slogans are the trademarks or service marks of us or our licensors. No trademark or service mark license is granted in connection with the materials contained on this Website.`, `Access to this Website does not authorize anyone to use any name, logo or mark in any manner whatsoever.`],
  Disclaimer: 'Disclaimer',
  DisclaimerContent: [`In no event will we be liable for any loss or damage including without limitation, indirect or consequential loss or damage, or any loss or damage whatsoever arising from loss of data or profits arising out of, or in connection with, the use of this website.`, `Every effort is made to keep the website up and running smoothly. However, Rentup takes no responsibility for, and will not be liable for, the website being temporarily unavailable due to technical issues beyond our control.`, `Rentup website can stop working for hours or days due to maintenance, hacking, or technical issues or any other reason; therefore, the company will not refund the client due to such challenges except if the down time exceeds 7 days within 30 days.`, `We do our best to ensuring that your information is secure. In order to prevent unauthorized access or disclosure we have put in place suitable physical, electronic and managerial procedures to safeguard and secure the information we collect online. Rentup uses a Secure Socket Layer system (SSL) to encrypt your entire payment session. SSL is an industry standard for keeping data and information secure and is used by lending companies, banks, and credit agencies.`, `We will not be liable for any loss or damage caused by a virus, distributed denial of service attack or other technological harmful material that may infect your computer equipment, computer programs, data or other proprietary material due to your use of our Website or to your downloading of any content on it, or any website linked to it.`, `In no event will we be liable for any damages (including, without limitation, damages for loss of data or profit, or due to business interruption) arising out of the use or inability to use the materials on the Website, even if one of our authorized representatives has been notified orally or in writing of the possibility of such damage.`, `Though we do our best to validate the new listed properties, we don’t hold any legal responsibilities for the listed properties or its authenticity or if the user is authorized by the owner of this property.`, `The client is responsible for the security of his account; therefore, we recommend safeguarding the account username and password to avoid account hijacking.`],
  Finally: 'Finally',
  FinallyContent: [`The client agrees to adhere to all the terms and conditions of Rentup and accepts that Rentup will delete any violating listings or accounts without offering any reimbursement.`, `Rentup reserves the right to change its terms at any time, and the new terms become effective immediately. Therefore, the client hereby accepts the current and future terms.`, `In the event user breach any of the above undertakings, Rentup is free to file a suit in any court of law and ask for appropriate compensations`],
  GOVERNINGLAW: 'GOVERNING LAW',
  GOVERNINGLAWCOTENT: [`These Terms of Use and your access to the Website is subject to and governed by the laws of the Arab Republic of Egypt. You agree to submit to the exclusive jurisdiction of the Courts of the Arab Republic of Egypt.`, `If any term of the Agreement is or may become for any reason invalid or unenforceable at law, the validity and enforceability of the remainder will not be affected.`]
});
